sys_variable_value.value:
(function execute(inputs, outputs) {

    // Split data into rows
    var rows = inputs.data.split('\n');

    // Initialize empty array for JSON objects
    var jsonData = [];

    // Iterate through rows and convert to JSON
    for (var i = 1; i < rows.length; i++) {
        
        // Skip empty lines
        if (rows[i].trim() === '') {
            continue;
        }

        var columns = rows[i].split(',');
        var data = {
            Date: columns[0],
            Type: columns[1],
            Price: parseFloat(columns[2])
        };
        jsonData.push(data);
}

// Convert array to JSON string
var jsonString = JSON.stringify(jsonData, null, 2);

// Log or use the resulting JSON string
// gs.info(jsonString);

outputs.json_data = jsonString

})(inputs, outputs);

